import React from 'react';
import './App.css';

function App() {






  return (
    <div className="App">
        <div className="logInForm">
            <h1>Log In</h1>

            <label htmlFor='email'>
               <input className='email' name='email' type='email' placeholder='Enter your Email'/>
            </label>

        </div>
    </div>
  );
}

export default App;
